import React from "react";
import { Col } from "react-bootstrap";

export interface Props {
  name: string;
  url: string;
  language: string;
}

const GitProject: React.SFC<Props> = ({ name, url, language }) => {
  return (
    <Col>
      <p>{name}</p>
      {language}
      {url}
    </Col>
  );
};

export default GitProject;
